function update( event ) {
	var time = event.time * 0.001;
	this.rotation.z = time * 0.1;
	this.position.z = (this.scale.z + 1) + (Math.sin( time ) * 0.1);

	this.position.y = time * 0.5;
	this.position.y = (this.scale.y + 1) + (Math.sin( time ) * 0.3);

}

